import React from 'react';
import { Outlet } from 'react-router-dom';
import { Header, Navigate } from '../../components';

const Public = () => {
  return (
    <div>
      <div className="w-full flex justify-center">
        <Header/>
        <Navigate/>
      </div>
      <div className="w-full flex justify-center">
        <Outlet />
      </div>
    </div>
  )
}

export default Public;
